'''Sola玄'''，是Bilibili弹幕视频网站的知名评论者，常常在四大欠王的作品中发表评论并获得最多赞同数。

曾在痒局长作品《【痒局长】干物女(WeiWei)【feat.KB】》中评论区称，与小伙伴打赌四大欠王在十一期间什么时候全投稿，就什么时候开始写作业{{黑幕|但到了十月六日白鼠还没投稿，因此她没有写作业}}。后因此事她被称为作业球。

其形象源于2016年1月14日她在B站上传的第一部作品《有何不可——A路人92岁生日快乐》，该视频于1月17日被顶上首页。

